import React from 'react'
import bioImg from "../assets/copy.JPG"

const Bio = () => {
  return (
    <div className="card-container">
        <div className="card">
        <img class = "bio-img" src={bioImg}/>
        </div>
    </div>
  )
}

export default Bio
